0:\"Previsualización del asunto/encabezado:\";'),('es','messages:blockedtitle','s:26:\"El usuario está bloqueado\";'),('es','messages:blockedtext','s:733:\"<strong>Tu nombre de usuario o dirección IP ha sido bloqueada.</strong>\n\nEl bloqueo fue hecho por $1.\nLa razón dada es <em>$2</em>.\n\n* Inicio del bloqueo: $8\n* Caducidad del bloqueo: $6\n* Bloqueo destinado a: $7\n\nPuedes contactar a $1 u otro [[{{MediaWiki:Grouppage-sysop}}|administrador]] para discutir el bloqueo.\nNo puedes utilizar la función «enviar correo electrónico a este usuario»  a menos que tengas una dirección de correo electrónico válida registrada en tus [[Special:Preferences|preferencias de usuario]] y que el bloqueo no haya inhabilitado esta función.\n\nTu dirección IP actual es $3, y el identificador del bloqueo es #$5.\nPor favor incluye todos los datos aquí mostrados en cualquier consulta que hagas.\";'),('es','messages:autoblockedtext','s:794:\"Tu dirección IP ha sido bloqueada automáticamente porque fue utilizada por otro usuario que fue bloqueado por $1.\nLa razón dada es esta:\n\n:<em>$2</em>\n\n* Inicio del bloqueo: $8\n* Caducidad del bloqueo: $6\n* Bloqueo destinado a: $7\n\nPuedes contactar con $1 o con otro de los [[{{MediaWiki:Grouppage-sysop}}|administradores]] para discutir el bloqueo.\n\nTen en cuenta que no podrás utilizar la herramienta de «enviar correo electrónico a este usuario» a menos que tengas una dirección de correo electrónico válida registrada en tus [[Special:Preferences|preferencias de usuario]] y que el bloqueo no haya inhabilitado esta función.\n\nTu actual dirección IP es $3, y el identificador del bloqueo es #$5.\nPor favor, incluye todos los datos mostrados aquí en cualquier consulta que hagas.\";'),('es','messages:blockednoreason','s:31:\"no se ha especificado el motivo\";'),('es','messages:whitelistedittext','s:37:\"Tienes que $1 para editar artículos.\";'),('es','messages:confirmedittext','s:192:\"Debes confirmar tu dirección electrónica antes de editar páginas. Por favor, establece y valida una dirección electrónica a través de tus [[Special:Preferences|preferencias de usuario]].\";'),('es','messages:nosuchsectiontitle','s:22:\"Sección no encontrada\";'),('es','messages:nosuchsectiontext','s:111:\"Has intentado editar una sección que no existe.\nQuizá ha sido movida o borrada mientras visitabas la página.\";'),('es','messages:loginreqtitle','s:28:\"Es necesario iniciar sesión\";'),('es','messages:loginreqlink','s:7:\"acceder\";'),('es','messages:loginreqpagetext','s:33:\"Debes $1 para ver otras páginas.\";'),('es','messages:accmailtitle','s:28:\"Se ha enviado la contraseña\";'),('es','messages:accmailtext','s:197:\"Se ha enviado a $2 una contraseña generada aleatoriamente para [[User talk:$1|$1]]. Puede cambiarse en la página [[Special:ChangePassword|destinada para ello]] después de haber iniciado sesión.\";'),('es','messages:newarticle','s:7:\"(Nuevo)\";'),('es','messages:newarticletext','s:235:\"Has seguido un enlace a una página que aún no existe.\nPara crear esta página, escribe en el campo a continuación. Para más información, consulta la [$1 página de ayuda].\nSi llegaste aquí por error, vuelve a la página anterior.\";'),('es','messages:anontalkpagetext','s:502:\"---- \'\'Esta es la página de discusión de un usuario anónimo que aún no ha creado una cuenta, o no la usa. Por lo tanto, tenemos que usar su dirección IP para identificarlo. Una dirección IP puede ser compartida por varios usuarios. Si eres un usuario anónimo y crees que se han dirigido a ti con comentarios improcedentes, por favor [[Special:UserLogin/signup|crea una cuenta]] o si ya la tienes [[Special:UserLogin|identifícate]] para evitar confusiones futuras con otros usuarios anónimos.\'\'\";'),('es','messages:noarticletext','s:314:\"En este momento no hay texto en esta página.\nPuedes [[Special:Search/{{PAGENAME}}|buscar el título de esta página]] en otras páginas,\n<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} buscar en los registros],\no [{{fullurl:{{FULLPAGENAME}}|action=edit}} editar esta página]</span>.\";'),('es','messages:noarticletext-nopermission','s:304:\"Actualmente no hay texto en esta página.\nPuedes [[Special:Search/{{PAGENAME}}|buscar este título de página]] en otras páginas, o <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} buscar en los registros relacionados]</span>, pero no tienes permiso para crear esta página.\";'),('es','messages:missing-revision','s:299:\"La revisión n.º $1 de la página llamada «{{FULLPAGENAME}}» no existe.\n\nNormalmente esto ocurre cuando se sigue un enlace de historial obsoleto que apunta a una página ya borrada.\nPuedes encontrar detalles en el [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} registro de borrados].\";'),('es','messages:userpage-userdoesnotexist','s:125:\"La cuenta de usuario «<nowiki>$1</nowiki>» no está registrada. Por favor comprueba si quieres crear o editar esta página.\";'),('es','messages:userpage-userdoesnotexist-view','s:48:\"La cuenta de usuario «$1» no está registrada.\";'),('es','messages:blocked-notice-logextract','s:130:\"Este usuario está actualmente bloqueado.\nLa última entrada del registro de bloqueos se proporciona debajo para mayor referencia:\";'),('es','messages:clearyourcache','s:515:\"\'\'\'Nota:\'\'\' después de guardar, quizás necesites refrescar la caché de tu navegador para ver los cambios.\n* \'\'\'Firefox / Safari:\'\'\' Mantén presionada \'\'Mayús\'\' mientras pulsas el botón \'\'Actualizar\'\', o presiona \'\'Ctrl+F5\'\' o \'\'Ctrl+R\'\' (\'\'⌘+R\'\' en Mac)\n* \'\'\'Google Chrome:\'\'\' presiona \'\'Ctrl+Shift+R\'\' (\'\'⌘+Mayús+R\'\' en Mac)\n* \'\'\'Internet Explorer:\'\'\' mantén presionada \'\'Ctrl\'\' mientras pulsas \'\'Actualizar\'\', o presiona \'\'Ctrl+F5\'\'\n* \'\'\'Opera:\'\'\' vacía la caché en \'\'Herramientas → Preferencias\'\'\";'),('es','messages:usercssyoucanpreview','s:97:\"\'\'\'Consejo:\'\'\' Usa el botón «{{int:showpreview}}» para probar el nuevo CSS antes de guardarlo.\";'),('es','messages:userjsyoucanpreview','s:96:\"\'\'\'Consejo:\'\'\' Usa el botón «{{int:showpreview}}» para probar el nuevo JS antes de guardarlo.\";'),('es','messages:usercsspreview','s:98:\"\'\'\'Recuerda que sólo estás previsualizando tu CSS de usuario.\'\'\'\n\'\'\'¡Aún no se ha guardado!\'\'\'\";'),('es','messages:userjspreview','s:106:\"\'\'\'¡Recuerda que solo estás previsualizando tu JavaScript de usuario.\'\'\'\n\'\'\'¡Aún no se ha guardado!\'\'\'\";'),('es','messages:sitecsspreview','s:88:\"\'\'\'Recuerda que sólo estás previsualizando este CSS\'\'\'\n\'\'\'¡Aún no se ha guardado!\'\'\'\";'),('es','messages:sitejspreview','s:104:\"\'\'\'Recuerda que sólo estás previsualizando este código JavaScript.\'\'\'\n\'\'\'¡Aún no se ha guardado!\'\'\'\";'),('es','messages:userinvalidcssjstitle','s:224:\"\'\'\'Aviso:\'\'\' No existe la apariencia «$1». Recuerda que las páginas personalizadas \'\'.css\'\' y \'\'.js\'\' tienen un título en minúsculas. Por ejemplo, {{ns:user}}:Ejemplo/vector.css en vez de {{ns:user}}:Ejemplo/Vector.css.\";'),('es','messages:updated','s:13:\"(Actualizado)\";'),('es','messages:note','s:22:\"<strong>Nota:</strong>\";'),('es','messages:previewnote','s:101:\"<strong>Recuerda que esta es una previsualización.</strong>\nTodavía no se han guardado tus cambios.\";'),('es','messages:continue-editing','s:23:\"Ir al área de edición\";'),('es','messages:previewconflict','s:119:\"Esta previsualización refleja el texto en el área de edición superior como aparecerá una vez guardados los cambios.\";'),('es','messages:session_fail_preview','s:197:\"\'\'\'No se pudo procesar la edición debido a una pérdida de los datos de sesión.\'\'\'\nInténtalo de nuevo.\nSi el problema persiste, [[Special:UserLogout|cierra la sesión]] y vuelve a identificarte.\";'),('es','messages:session_fail_preview_html','s:413:\"\'\'\'Lo sentimos, no hemos podido procesar tu cambio debido a una pérdida de datos de sesión.\'\'\'\n\n\'\'Puesto que este wiki tiene el HTML puro habilitado, la visión preliminar está oculta para prevenirse contra ataques en JavaScript.\'\'\n\n\'\'\'Si éste es un intento legítimo de modificación, por favor, inténtalo de nuevo. Si aún así no funcionase, [[Special:UserLogout|cierra la sesión]] e ingresa de nuevo.\'\'\'\";'),('es','messages:token_suffix_mismatch','s:273:\"\'\'\'Tu edición ha sido rechazada porque tu cliente ha mezclado los signos de puntuación en el token de edición.\nSe rechazó la edición para evitar que el texto de la página se corrompa.\nEsto sucede en ocasiones cuando se usa un servicio de proxy anónimo defectuoso.\'\'\'\";'),('es','messages:edit_form_incomplete','s:139:\"\'\'\'Algunas partes del formulario de edición no llegaron al servidor, comprueba que tus ediciones están intactas e inténtalo de nuevo\'\'\'.\";'),('es','messages:editing','s:18:\"Edición de «$1»\";'),('es','messages:creating','s:19:\"Crear la página $1\";'),('es','messages:editingsection','s:20:\"Editar $1 (sección)\";'),('es','messages:editingcomment','s:35:\"Edición de «$1» (sección nueva)\";'),('es','messages:editconflict','s:25:\"Conflicto de edición: $1\";'),('es','messages:explainconflict','s:382:\"Alguien más ha cambiado esta página desde que empezaste a editarla.\nEl área de texto superior contiene el texto de la página como existe actualmente.\nTus cambios se muestran en el área de texto inferior.\nSi quieres grabar tus cambios, has de trasladarlos al área superior.\n\'\'\'Sólo\'\'\' el texto en el área de texto superior será grabado cuando pulses «{{int:savearticle}}».\";'),('es','messages:yourtext','s:8:\"Tu texto\";'),('es','messages:storedversion','s:19:\"Versión almacenada\";'),('es','messages:nonunicodebrowser','s:246:\"\'\'\'Atención: Tu navegador no cumple la norma Unicode.\'\'\'\nSe ha activado un sistema de edición alternativo que te permitirá editar artículos con seguridad: los caracteres no ASCII aparecerán en la caja de edición como códigos hexadecimales.\";'),('es','messages:editingold','s:139:\"\'\'\'Aviso: Estás editando una versión antigua de esta página.\'\'\'\nSi la guardas, se perderán los cambios realizados desde esta revisión.\";'),('es','messages:yourdiff','s:11:\"Diferencias\";'),('es','messages:copyrightwarning','s:434:\"Por favor observa que todas las contribuciones a {{SITENAME}} se consideran hechas públicas bajo la $2 (véase $1 para más detalles). Si no deseas la modificación y distribución libre de tu obra, entonces no la pongas aquí.<br />También nos aseguras que tú escribiste esto y te pertenecen de los derechos de autor, o lo copiaste desde el dominio público u otra fuente libre. \'\'\'¡No uses escritos con copyright sin permiso!\'\'\'\";'),('es','messages:copyrightwarning2','s:486:\"Por favor, ten en cuenta que todas las contribuciones a {{SITENAME}} pueden ser editadas, modificadas o eliminadas por otros colaboradores. Si no deseas que las modifiquen sin limitaciones y las distribuyan libremente, entonces no las pongas aquí.<br />También nos aseguras que tú escribiste esto y te pertenecen de los derechos de autor, o lo copiaste desde el dominio público u otra fuente libre. (véase $1 para más detalles).\n\'\'\'¡No uses escritos con copyright sin permiso!\'\'\'\";'),('es','messages:longpageerror','s:173:\"\'\'\'Error: El texto que has enviado ocupa {{PLURAL:$1|un kilobyte|$1 kilobytes}}, que excede el máximo de {{PLURAL:$2|un kilobyte|$2 kilobytes}}.\'\'\' \nNo se lo puede guardar.\";'),('es','messages:readonlywarning','s:287:\"\'\'\'Advertencia: La base de datos ha sido bloqueada para mantenimiento, así que no podrás guardar tus ediciones en este momento.\'\'\'\nQuizás quieras copiar y pegar tu texto en un archivo de texto y guardarlo para después.\n\nEl administrador que lo bloqueó ofreció esta explicación: $1\";'),('es','messages:protectedpagewarning','s:193:\"\'\'\'Aviso: Esta página ha sido protegida de manera que solo usuarios con permisos de administrador puedan editarla.\'\'\'\nA continuación se muestra la última entrada de registro para referencia:\";'),('es','messages:semiprotectedpagewarning','s:168:\"\'\'\'Nota:\'\'\' Esta página ha sido protegida para que solo usuarios registrados puedan editarla.\nA continuación se provee la última entrada de registro para referencia:\";'),('es','messages:cascadeprotectedwarning','s:201:\"\'\'\'Aviso:\'\'\' Esta página está protegida, solo los administradores pueden editarla porque está incluida en  {{PLURAL:$1|la siguiente página protegida|las siguientes páginas protegidas}} en cascada:\";'),('es','messages:titleprotectedwarning','s:204:\"\'\'\'Aviso: Esta página está protegida de modo que se necesitan [[Special:ListGroupRights|derechos especificos]] para crearla.\'\'\'\nA continuación se muestra la última entrada de registro para referencia:\";'),('es','messages:templatesused','s:64:\"{{PLURAL:$1|Plantilla usada|Plantillas usadas}} en esta página:\";'),('es','messages:templatesusedpreview','s:74:\"{{PLURAL:$1|Plantilla usada|Plantillas usadas}} en esta previsualización:\";'),('es','messages:templatesusedsection','s:65:\"{{PLURAL:$1|Plantilla usada|Plantillas usadas}} en esta sección:\";'),('es','messages:template-protected','s:11:\"(protegida)\";'),('es','messages:template-semiprotected','s:15:\"(semiprotegida)\";'),('es','messages:hiddencategories','s:87:\"Esta página es un miembro de {{PLURAL:$1|1 categoría oculta|$1 categorías ocultas}}:\";'),('es','messages:edittools','s:73:\"<!-- Este texto aparecerá bajo los formularios de edición y subida. -->\";'),('es','messages:nocreatetext','s:176:\"{{SITENAME}} ha restringido la posibilidad de crear nuevas páginas.\nPuede volver atrás y editar una página existente, [[Special:UserLogin|identificarte o crear una cuenta]].\";'),('es','messages:nocreate-loggedin','s:45:\"No tienes permiso para crear páginas nuevas.\";'),('es','messages:sectioneditnotsupported-title','s:34:\"Edición de sección no compatible\";'),('es','messages:sectioneditnotsupported-text','s:58