dor puedan trasladarla.\nA continuación se muestra la última entrada de registro para referencia:\";'),('es','messages:semiprotectedpagemovewarning','s:174:\"\'\'\'Nota:\'\'\' Esta página ha sido bloqueada para que  solamente usuarios registrados pueden moverla.\nA continuación se muestra la última entrada de registro para referencia:\";'),('es','messages:move-over-sharedrepo','s:137:\"== El archivo existe ==\n[[:$1]] existe en un repositorio compartido. El traslado a este título invalidará la compartición del archivo.\";'),('es','messages:file-exists-sharedrepo','s:110:\"El nombre de archivo elegido ya está siendo usado en un repositorio compartido.\nPor favor, elige otro nombre.\";'),('es','messages:export','s:17:\"Exportar páginas\";'),('es','messages:exporttext','s:695:\"Puedes exportar el texto y el historial de ediciones de una página en particular o de un conjunto de páginas a un texto XML. En el futuro, este texto podría importarse en otro wiki que ejecutase MediaWiki a través de [[Special:Import|importar página]].\n\nPara exportar páginas, escribe los títulos en la caja de texto de abajo, un título por línea, y selecciona si quieres la versión actual junto a las versiones anteriores, con las líneas del historial, o sólo la versión actual con la información sobre la última edición.\n\nEn el último caso también puedes usar un enlace, por ejemplo [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] para la página \"[[{{MediaWiki:Mainpage}}]]\".\";'),('es','messages:exportall','s:27:\"Exportar todas las páginas\";'),('es','messages:exportcuronly','s:77:\"Incluye sólo la revisión actual, no el historial de revisiones al completo.\";'),('es','messages:exportnohistory','s:158:\"----\n\'\'\'Nota:\'\'\' Exportar el historial completo de páginas a través de este formulario ha sido deshabilitado debido a problemas de rendimiento del servidor.\";'),('es','messages:exportlistauthors','s:61:\"Incluir una lista completa de colaboradores para cada página\";'),('es','messages:exp