memail_pending','s:188:\"Ya se te ha enviado un código de confirmación; si creaste una cuenta recientemente, puede que tengas que esperar unos minutos para que te llegue antes de intentar pedir un nuevo código.\";'),('es','messages:confirmemail_send','s:35:\"Envíar el código de confimación.\";'),('es','messages:confirmemail_sent','s:32:\"Confirmación de correo enviada.\";'),('es','messages:confirmemail_oncreate','s:243:\"Se ha enviado un código de confirmación a tu dirección de correo electrónico.\nEste código no es necesario para iniciar sesión, pero necesitarás proporcionarlo antes de activar cualquier función basada en correo electrónico en el wiki.\";'),('es','messages:confirmemail_sendfailed','s:143:\"No fue posible enviar el correo de confirmación. Por favor, comprueba la validez de la dirección de correo.\n\nEl servidor indicó el error: $1\";'),('es','messages:confirmemail_invalid','s:68:\"Código de confirmación incorrecto. El código debe haber expirado.\";'),('es','messages:confirmemail_needlogin','s:55:\"Necesitas $1 para confirmar tu dirección electrónica.\";'),('es','messages:confirmemail_success','s:115:\"Su dirección de correo ha sido confirmada\nAhora puedes [[Special:UserLogin|identificarte]] y colaborar en el wiki.\";'),('es','messages:confirmemail_loggedin','s:56:\"Tu dirección de correo electrónico ha sido confirmada.\";'),('es','messages:confirmemail_subject','s:56:\"confirmación de la dirección de correo de {{SITENAME}}\";'),('es','messages:confirmemail_body','s:418:\"Alguien, probablemente usted mismo, ha registrado desde la dirección IP $1 la cuenta \"$2\" en {{SITENAME}}, utilizando esta dirección de correo.\n\nPara confirmar que esta cuenta realmente le pertenece y activar el correo en {{SITENAME}}, siga este enlace:\n\n$3\n\nSi la cuenta *no* es suya, siga este otro enlace para cancelar la confirmación de la dirección de correo:\n\n$5\n\nEl código de confirmación expirará en $4.\";'),('es','messages:confirmemail_body_changed','s:461:\"Alguien, probablemente tú,\nha modificado la dirección de correo electrónico asociado a la cuenta \"$2\" hacia esta en {{SITENAME}}, desde la dirección IP $1.\n\nPara confirmar que esta cuenta realmente te pertenece y reactivar las funciones de correo electrónico en {{SITENAME}}, abre este enlace en su navegador:\n\n$3\n\nSi la cuenta *no* te pertenece, sigue el siguiente enlace para cancelar la confirmación:\n\n$5\n\nEste código de confirmación expirará el $4.\";'),('es','messages:confirmemail_body_set','s:484:\"Alguien, probablemente tu desde la dirección IP $1,\nha cambiado la dirección de correo electrónico de la cuenta $2 a esta dirección en {{SITENAME}}.\n\nPara confirmar que esta cuenta realmente te pertenece y activar las capacidades del correo electrónico en {{SITENAME}}, abre este enlace en tu navegador:\n\n$3\n\nSi la cuenta *no* te pertenece sigue entonces este otro enlace para cancelar la confirmación del correo electrónico:\n\n$5\n\nEste código de confirmación caducará el $4.\";'),('es','messages:confirmemail_invalidated','s:74:\"La confirmación de la dirección de correo electrónico ha sido cancelada\";'),('es','messages:invalidateemail','s:45:\"Cancelar confirmación de correo electrónico\";'),('es','messages:scarytranscludedisabled','s:45:\"[Transclusión interwiki está deshabilitada]\";'),('es','messages:scarytranscludefailed','s:40:\"[Obtención de plantilla falló para $1]\";'),('es','messages:scarytranscludefailed-httpstatus','s:54:\"[Error de recuperación de plantilla para $1: HTTP $2]\";'),('es','messages:scarytranscludetoolong','s:27:\"[El URL es demasiado largo]\";'),('es','messages:deletedwhileediting','s:80:\"\'\'\'Aviso\'\'\': ¡Esta página fue borrada después de que usted empezara a editar!\";'),('es','messages:confirmrecreate','s:193:\"El usuario [[User:$1|$1]] ([[User talk:$1|disc.]]) borró esta página después de que comenzaste a editarla, por el motivo:\n: \'\'$2\'\'\nConfirma que realmente quieres volver a crear esta página.\";'),('es','messages