INSERT INTO `text` VALUES (1,'<strong>MediaWiki se ha instalado con éxito.<strong>\n\nConsulta la [//meta.wikimedia.org/wiki/Help:Contents/es guía del usuario] para obtener información sobre el uso del software wiki.\n\n== Primeros pasos ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Lista de ajustes de configuración]\n* [//www.mediawiki.org/wiki/Manual:FAQ/es Preguntas frecuentes sobre MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de publicación de MediaWiki]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Traducir MediaWiki en tu idioma]','utf-8'),(2,'<strong>¿Conoces el mundo que te rodea?.<strong>\n\n\nLa idea de este proyecto es incentivar a las personas a abrir sus alas e invitarlos a conocer el mundo empezando por valorar sus orígenes y alrededores.\n\n\n= Elementos ==\n\n== Aventurero ==\n\nEres TU!, estas invitado a descubrir y nutrirte de lo que surge cuando conoces lugares y modos de vida distintos.\n\n== Retos ==\n\nSon el medio por el cual te incentivamos a descubrir y aprender\n\n== Categorías ==\n\nSon las áreas que creemos que puedes aprenderlas utilizando [[Aprendiendo]]\n\n== Metas alcanzadas ==','utf-8'),(3,'<strong>¿Conoces el mundo que te rodea?.<strong>\n\n\nLa idea de este proyecto es incentivar a las personas a abrir sus alas e invitarlos a conocer el mundo empezando por valorar sus orígenes y alrededores.\n\n\n= Elementos ==\n\n== Aventurero ==\n\nEres TU!, estas invitado a descubrir y nutrirte de lo que surge cuando conoces lugares y modos de vida distintos.\n\n== Categorías ==\n\nSon las áreas que creemos que puedes aprenderlas utilizando [[Aprendiendo]]\n\n== Retos ==\n\nSon el medio por el cual te incentivamos a descubrir y aprender\n\n== Items ==\n\nSon los elementos que conforman los Retos, estos pueden ser muy variados desde un lugar del mundo hasta una actividad especifica.\n\n== Metas alcanzadas ==\n\nSon las recompensas que recibes por cumplir un Item o pasar un Reto','utf-8'),(4,'<strong>¿Conoces el mundo que te rodea?.<strong>\n\n\nLa idea de este proyecto es incentivar a las personas a abrir sus alas e invitarlos a conocer el mundo empezando por valorar sus orígenes y alrededores.\n\n\n= Elementos =\n\n== Aventurero ==\n\nEres TU!, estas invitado a descubrir y nutrirte de lo que surge cuando conoces lugares y modos de vida distintos.\n\n== Categorías ==\n\nSon las áreas que creemos que puedes aprenderlas utilizando [[Aprendiendo]]\n\n== Retos ==\n\nSon el medio por el cual te incentivamos a descubrir y aprender\n\n== Items ==\n\nSon los elementos que conforman los Retos, estos pueden ser muy variados desde un lugar del mundo hasta una actividad especifica.\n\n== Metas alcanzadas ==\n\nSon las recompensas que recibes por cumplir un Item o pasar un Reto','utf-8'),(5,'<strong>¿Conoces el mundo que te rodea?.<strong>\n\n\nLa idea de este proyecto es incentivar a las personas a abrir sus alas e invitarlos a conocer el mundo empezando por valorar sus orígenes y alrededores.\n\n\n= Elementos =\n\n== Aventurero ==\n\nEres TU!, estas invitado a descubrir y nutrirte de lo que surge cuando conoces lugares y modos de vida distintos.\n\n== Categorías ==\n\nSon las áreas que creemos que puedes aprenderlas utilizando [[Aprendiendo]]\n\n== Retos ==\n\nSon el medio por el cual te incentivamos a descubrir y aprender\n\n[[Retos]]\n\n== Items ==\n\nSon los elementos que conforman los Retos, estos pueden ser muy variados desde un lugar del mundo hasta una actividad especifica.\n\n== Metas alcanzadas ==\n\nSon las recompensas que recibes por cumplir un Item o pasar un Reto','utf-8'),(6,'= Descripción =\n\n Son un conjunto de actividades o lugares que el [[Aventurero]] tiene que cumplir\n= Puntuación =','utf-8'),(7,'= Descripción =\n\n Son un conjunto de actividades o lugares que el [[Aventurero]] tiene que cumplir\n= Puntuación =\n\n\nEn cada reto se puede estar en nivel bronce,plata, y oro.\n\nY para llegar a cada nivel se suma el numero de items por reto.\n\n== Bronce ==\n\nHaber completado el 30% de los [[items]].\n\nEl [[Aventurero]] recibe un reconocimiento\n\n== Plata ==\n\nHaber completado el 60% de los [[items]]\n\n== Oro ==\n\nHaber completado el 100% de los [[items]]','utf-8'),(8,'= Obtener Ruta de servidor =\n\n  var port = window.location.port;\n  var pathArray = window.location.pathname.split(\'/\');\n  var applicacion = ( window.location.host === \"127.0.0.1\" || window.location.host === \"localhost\" || window.location.host.indexOf(\'192.168.\') !== -1 ) ? pathArray[1] : \' \';\n  if ( port === \"3000\" ) {\n      applicacion = applicacion+\'pos/\';\n  }\n  if ( !window.location.origin ) {\n      return window.location.protocol + \"//\" + window.location.host + \"/\" + applicacion;\n  } else {\n      return window.location.origin + \"/\" + applicacion;\n  }','utf-8'),(9,'= Listar directorios (ls) =\n\n Ordenar por fecha descendentemente \n  \'\'ls -lt\'\'\n\n----\n\n Ordenar por fecha ascendentemente \n  \'\'ls -ltr\'\'\n\n\n----\n\n Ordenar por tamaño ascendentemente \n  \'\'ls -l --sort=size\'\'\n\n\n----\n\n Ordenar por tamaño ascendentemente \n  \'\'ls -lr --sort=size\'\'','utf-8'),(10,'= Listar directorios (ls) =\n\n Ordenar por fecha descendentemente \n  \'\'ls -lt\'\'\n\n----\n\n Ordenar por fecha ascendentemente \n  \'\'ls -ltr\'\'\n\n----\n\n Ordenar por tamaño descendentemente \n  \'\'ls -l --sort=size\'\'\n\n----\n\n Ordenar por tamaño ascendentemente \n  \'\'ls -lr --sort=size\'\'','utf-8'),(11,'Lenguajes de Programacion que utilizo\n\n[[SQL]]\n[[JAVASCRIPT]]\n[[JAVA]]\n[[PHP]]\n[[BASH]]\n\n\nHerramientas utiles\n\n[[npm]]\n[[composer]]\n\n[[Gulp]]\n[[bower]]\n\n\nIDEs\n[[Sublime Text]]\n[[Android Studio]]','utf-8'),(12,'Lenguage de lado del cliente con multiples y poderosos plugins.\n\n=Funciones=\n [[Funciones]]\n\n=Librerias=\n jquery\n browsify','utf-8'),(13,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l','utf-8'),(14,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l\n\n=Recorrer los archivos de un directorio =\n #!/bin/bash\n DIR=$@\n cd $DIR\n function leer()\n {\n    dir=$(dir -1)\n    for file in $dir\n    do\n        mv $file \"/media/dexter/datos_yo/ORT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR','utf-8'),(15,'Lenguajes de Programacion que utilizo\n\n[[SQL]]\n[[JAVASCRIPT]]\n[[JAVA]]\n[[PHP]]\n[[BASH]]\n\n\nHerramientas utiles\n\n[[npm]]\n[[composer]]\n\n[[Gulp]]\n[[bower]]\n\n\nIDEs\n[[Sublime Text]]\n[[Android Studio]]\n\n=Tutos=\n[[Publicando Ortofotos en mapserver]]','utf-8'),(16,'=Herramientas=\n\nLibreria de código abierto GDAL/OGR\n\n=Comandos=\n\n==Obtener meta-información de Shapefile(.shp)==\n\n ogrinfo shape.shp\n\n==Obtener meta-información de (.tif)==\n\n gdalinfo imagen.tif\n\n==Comprimir ortofotos==\n\n gdal_translate -outsize 25% 25% Origen.tif destino.tif\n\n==Crear shapefile para agrupar ortofotos==\n\n gdaltindex -t_srs EPSG:31977 -src_srs_name \"EPSG:31977\" destino.shp /ruta_ortofotos/*.tif\n\n\n==Layer para agregar a Mapfile==\n\n LAYER\n  NAME \"Ortofotos\"\n  STATUS ON\n  TYPE RASTER\n  TILEINDEX \"destino.shp\"\n  TILEITEM \"location\"\n  TILESRS \"EPSG_31977\"\n  PROCESSING \"BANDS=1,2,3\"\n END','utf-8'),(17,'=Herramientas=\n\nLibreria de código abierto GDAL/OGR\n\n=Comandos=\n\n==Obtener meta-información de Shapefile(.shp)==\n\n ogrinfo shape.shp\n\n==Obtener meta-información de (.tif)==\n\n gdalinfo imagen.tif\n\n==Comprimir ortofotos==\n \n gdal_translate -outsize 25% 25% Origen.tif destino.tif\n\n==Crear shapefile para agrupar ortofotos==\n\n gdaltindex -t_srs EPSG:31977 -src_srs_name \"EPSG:31977\" destino.shp /ruta_ortofotos/*.tif\n\n\n==Layer para agregar a Mapfile==\n\n LAYER\n  NAME \"Ortofotos\"\n  STATUS ON\n  TYPE RASTER\n  TILEINDEX \"destino.shp\"\n  TILEITEM \"location\"\n  TILESRS \"EPSG_31977\"\n  PROCESSING \"BANDS=1,2,3\"\n END\n\n==Fuentes==\n\n[http://live.osgeo.org/en/quickstart/gdal_quickstart.html GDAL quickstart ]','utf-8'),(18,'=Herramientas=\n\nLibreria de código abierto GDAL/OGR\n\n=Comandos=\n\n==Obtener meta-información de Shapefile(.shp)==\n\n ogrinfo shape.shp\n\n==Obtener meta-información de (.tif)==\n\n gdalinfo imagen.tif\n\n==Comprimir ortofotos==\n \n gdal_translate -outsize 25% 25% Origen.tif destino.tif\n\n==Crear shapefile para agrupar ortofotos==\n\n gdaltindex -t_srs EPSG:31977 -src_srs_name \"EPSG:31977\" destino.shp /ruta_ortofotos/*.tif\n\n\n==Layer para agregar a Mapfile==\n\n LAYER\n  NAME \"Ortofotos\"\n  STATUS ON\n  TYPE RASTER\n  TILEINDEX \"destino.shp\"\n  TILEITEM \"location\"\n  TILESRS \"EPSG_31977\"\n  PROCESSING \"BANDS=1,2,3\"\n END\n\n==Fuentes==\n\n[http://live.osgeo.org/en/quickstart/gdal_quickstart.html GDAL quickstart ]\n\n[http://www.mapserver.org/optimization/tileindex.html#tileindex-mixed-srs TILES MAPSERVER]','utf-8'),(19,'Lenguajes de Programacion que utilizo\n\n[[SQL]]\n[[JAVASCRIPT]]\n[[JAVA]]\n[[PHP]]\n[[BASH]]\n\n\nHerramientas utiles\n\n[[npm]]\n[[composer]]\n\n[[Gulp]]\n[[bower]]\n\n\nIDEs\n[[Sublime Text]]\n[[Android Studio]]\n\n=Tutos=\n[[Publicando Ortofotos en mapserver]]\n\n[[Intro WMS]]','utf-8'),(20,'<strong>¿Conoces el mundo que te rodea?.<strong>\n\n\nLa idea de este proyecto es incentivar a las personas a abrir sus alas e invitarlos a conocer el mundo empezando por valorar sus orígenes y alrededores.\n\n\n= Elementos =\n\n== Aventurero ==\n\nEres TU!, estas invitado a descubrir y nutrirte de lo que surge cuando conoces lugares y modos de vida distintos.\n\n== Categorías ==\n\nSon las áreas que creemos que puedes aprenderlas utilizando [[Aprendiendo]]\n\n== Retos ==\n\nSon el medio por el cual te incentivamos a descubrir y aprender\n\n[[Retos]]\n\n== Items ==\n\nSon los elementos que conforman los Retos, estos pueden ser muy variados desde un lugar del mundo hasta una actividad especifica.\n\n== Metas alcanzadas ==\n\nSon las recompensas que recibes por cumplir un Item o pasar un Reto\