RT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR\n\n=Descargar subdirectorio recursivamente=\n\n wget -r --no-parent http://url.com/subdirectorio/\n wget -r --no-parent -e robots=off http://url.com/subdirectorio/','utf-8'),(35,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l\n\n=Recorrer los archivos de un directorio =\n #!/bin/bash\n DIR=$@\n cd $DIR\n function leer()\n {\n    dir=$(dir -1)\n    for file in $dir\n    do\n        mv $file \"/media/dexter/datos_yo/ORT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR\n\n=Descargar subdirectorio recursivamente=\n\n wget -r --no-parent http://url.com/subdirectorio/\n wget -r --no-parent -e robots=off http://url.com/subdirectorio/\n\n=Ejecutar comando en varios archivos de un directorio recursivamente=\n \n for i in *; do rm -f ./$i/index.html* ; done','utf-8'),(36,'\n [[Publicando Ortofotos en mapserver]]\n\n [[Intro WMS]]\n\n=Lenguajes de Programación=\n\n[[SQL]]\n\n[[JAVASCRIPT]]\n\n[[JAVA]]\n\n[[PHP]]\n\n[[BASH]]\n\n\n=Herramientas útiles=\n\n[[npm]]\n\n[[composer]]\n\n[[Gulp]]\n\n[http://blog.teamtreehouse.com/getting-started-bower Bower]\n\n=IDEs=\n[[Sublime Text]]\n\n[[Android Studio]]','utf-8'),(37,'En esta página se enumeran y describen los pasos para publicar un Servicio Web de Mapas (WMS-Web Map Service). \n\nPara esta práctica se utilizaron las siguientes herramientas:\n \n MapServer versión 6.4.1\n php 5.5.9\n QGIS 2.6\n\n=MapServer=\n Es una herramienta open source que permite compartir y analizar nuestra información vectorial o raster en difenretes formatos como imagenes, tablas, geojson, xml y demas, para profundizar sobre qué es MapServer pueden revisar su página oficial http://www.mapserver.org/introduction.html#mapserver-overview\n\n=php=\n Es un lenguage de programación del lado de servidor utilizado generalmente para construir aplicaciones web.\n\n=QGIS=\n Es una herramienta de escritorio open source que permite visualizar, administrar, editar y analizar información geográfica.','utf-8'),(38,'En esta página se enumeran y describen los pasos para publicar un Servicio Web de Mapas (WMS-Web Map Service). \n\nPara esta práctica se utilizaron las siguientes herramientas:\n \n MapServer versión 6.4.1\n php 5.5.9\n QGIS 2.6\n\n=MapServer=\n Es una herramienta open source que permite compartir y analizar nuestra información vectorial o raster en difenretes formatos como imagenes, tablas, geojson, xml y demas, para profundizar sobre qué es MapServer pueden revisar su página oficial http://www.mapserver.org/introduction.html#mapserver-overview\n\n=php=\n Es un lenguage de programación del lado de servidor utilizado generalmente para construir aplicaciones web.\n\n=QGIS=\n Es una herramienta de escritorio open source que permite visualizar, administrar, editar y analizar información geográfica.\n\n\n=Publicando Mapas=\n\n==TEMPLATE-DRIVEN OUTPUT==\n\n OUTPUTFORMAT\n  NAME \'text/html\'\n  DRIVER \'template\'\n  FORMATOPTION \'FILE=tmpl.html\'\n END\n\n OUTPUTFORMAT\n  NAME \'application/geojson\'\n  DRIVER \'template\'\n  FORMATOPTION \'FILE=base.js\'\n END','utf-8'),(39,'En esta página se enumeran y describen los pasos para publicar un Servicio Web de Mapas (WMS-Web Map Service). \n\nPara esta práctica se utilizaron las siguientes herramientas:\n \n MapServer versión 6.4.1\n php 5.5.9\n QGIS 2.6\n\n=MapServer=\n Es una herramienta open source que permite compartir y analizar nuestra información vectorial o raster en difenretes formatos como imagenes, tablas, geojson, xml y demas, para profundizar sobre qué es MapServer pueden revisar su página oficial http://www.mapserver.org/introduction.html#mapserver-overview\n\n=php=\n Es un lenguage de programación del lado de servidor utilizado generalmente para construir aplicaciones web.\n\n=QGIS=\n Es una herramienta de escritorio open source que permite visualizar, administrar, editar y analizar información geográfica.\n\n\n=Publicando Mapas=\n\n==TEMPLATE-DRIVEN OUTPUT==\n\n OUTPUTFORMAT\n  NAME \'text/html\'\n  DRIVER \'template\'\n  FORMATOPTION \'FILE=tmpl.html\'\n END\n\n OUTPUTFORMAT\n  NAME \'application/geojson\'\n  DRIVER \'template\'\n  FORMATOPTION \'FILE=base.js\'\n END\n\n\n WEB\n  METADATA\n   wms_srs \"EPSG:4326\"\n   wms_enable_request \"*\"\n   wms_feature_info_mime_type \"text/html, application/json, application/geojson\"\n   wms_include_items \"all\"\n  END\n END\n\n LAYER\n  METADATA\n   wms_srs EPSG:4326\n   wms_enable_request \"*\"\n   wms_getfeature_formatlist \"text/html, application/json, application/geojson\"\n  END\n END','utf-8'),(40,'En esta página se enumeran y describen los pasos para publicar un Servicio Web de Mapas (WMS-Web Map Service). \n\nPara esta práctica se utilizaron las siguientes herramientas:\n \n MapServer versión 6.4.1\n php 5.5.9\n QGIS 2.6\n\n=MapServer=\n Es una herramienta open source que permite compartir y analizar nuestra información vectorial o raster en difenretes formatos como imagenes, tablas, geojson, xml y demas, para profundizar sobre qué es MapServer pueden revisar su página oficial http://www.mapserver.org/introduction.html#mapserver-overview\n\n=php=\n Es un lenguage de programación del lado de servidor utilizado generalmente para construir aplicaciones web.\n\n=QGIS=\n Es una herramienta de escritorio open source que permite visualizar, administrar, editar y analizar información geográfica.\n\n\n=Publicando Mapas=\n\n==TEMPLATE-DRIVEN OUTPUT==\n\n WEB\n #Template para geojson\n  OUTPUTFORMAT\n   NAME \'application/geojson\'\n   DRIVER \'template\'\n   FORMATOPTION \'FILE=base.js\'\n  END\n #Template para html\n  OUTPUTFORMAT\n   NAME \'text/html\'\n   DRIVER \'template\'\n   FORMATOPTION \'FILE=tmpl.html\'\n  END\n\n  METADATA\n   wms_srs \"EPSG:4326\"\n   wms_enable_request \"*\"\n   wms_feature_info_mime_type \"text/html, application/json, application/geojson\"\n   wms_include_items \"all\"\n  END\n END\n\n LAYER\n  METADATA\n   wms_srs EPSG:4326\n   wms_enable_request \"*\"\n   wms_getfeature_formatlist \"text/html, application/json, application/geojson\"\n  END\n END','utf-8'),(41,'En esta página se enumeran y describen los pasos para publicar un Servicio Web de Mapas (WMS-Web Map Service). \n\nPara esta práctica se utilizaron las siguientes herramientas:\n \n MapServer versión 6.4.1\n php 5.5.9\n QGIS 2.6\n\n=MapServer=\n Es una herramienta open source que permite compartir y analizar nuestra información vectorial o raster en difenretes formatos como imagenes, tablas, geojson, xml y demas, para profundizar sobre qué es MapServer pueden revisar su página oficial http://www.mapserver.org/introduction.html#mapserver-overview\n\n=php=\n Es un lenguage de programación del lado de servidor utilizado generalmente para construir aplicaciones web.\n\n=QGIS=\n Es una herramienta de escritorio open source que permite visualizar, administrar, editar y analizar información geográfica.\n\n\n=Publicando Mapas=\n\n==TEMPLATE-DRIVEN OUTPUT==\n\n WEB\n #Template para geojson\n  OUTPUTFORMAT\n   NAME \'application/geojson\'\n   DRIVER \'template\'\n   FORMATOPTION \'FILE=base.js\'\n  END\n #Template para html\n  OUTPUTFORMAT\n   NAME \'text/html\'\n   DRIVER \'template\'\n   FORMATOPTION \'FILE=tmpl.html\'\n  END\n  METADATA\n   wms_srs \"EPSG:4326\"\n   wms_enable_request \"*\"\n   wms_feature_info_mime_type \"text/html, application/json, application/geojson\"\n   wms_include_items \"all\"\n  END\n END\n\n LAYER\n  METADATA\n   wms_srs EPSG:4326\n   wms_enable_request \"*\"\n   wms_getfeature_formatlist \"text/html, application/json, application/geojson\"\n  END\n END','utf-8'),(42,'= Colaboraciones =\n\nAyuda en TICS. [[Publicando_Ortofotos_en_mapserver]]\n\n [[Intro WMS]]\n\n=Colaboradores=\nLos nuevos miembros deben editar esta sección y agregar el enlace hacia su página <nowiki>[[Usuario:Nombre]]</nowiki> desde la que haran referencia a sus nuevas colaboraciones.\n\n[[Usuario:Dexter]]\n\n[[Usuario:Mariofertc]]\n\n=Proyectos=\n\n[[Aventureando]]\n\n[[rrnn]]','utf-8'),(43,'= Colaboraciones =\n\n Ayuda en TICS. [[Publicando_Ortofotos_en_mapserver]]\n\n [[Intro WMS]]\n\n=Colaboradores=\nLos nuevos miembros deben editar esta sección y agregar el enlace hacia su página <nowiki>[[Usuario:Nombre]]</nowiki> desde la que haran referencia a sus nuevas colaboraciones.\n\n[[Usuario:Dexter]]\n\n[[Usuario:Mariofertc]]\n\n=Proyectos=\n\n[[Aventureando]]\n\n[[rrnn]]','utf-8'),(44,'\n [[Publicando Ortofotos en mapserver]]\n\n [[Intro WMS]]\n\n=Lenguajes de Programación=\n\n[[SQL]]\n\n[[JAVASCRIPT]]\n\n[[JAVA]]\n\n[[PHP]]\n\n[[BASH]]\n\n[[MONGODB]]\n\n=Herramientas útiles=\n\n[[npm]]\n\n[[composer]]\n\n[[Gulp]]\n\n[http://blog.teamtreehouse.com/getting-started-bower Bower]\n\n=IDEs=\n[[Sublime Text]]\n\n[[Android Studio]]','utf-8'),(45,'=Acceder a mongo=\n mongo 192.168.1.1/nombreDB\n\n=Si la autenticación esta habilitada, agregar usuario y pass=\n use admin;\n db.auth(\'user\',\'password\');\n\n=Listar bases de datos=\n show databases;\n \n=Lista colleciones de la BDD=\n show collections;\n\n=Sentencias de selección=\n Listar todos los objetos de una colección\n db.nombre_colleccion.find();\n\n Listar un objeto de la colección\n db.nombre_colleccion.findOne();\n\n Realizar una operación con cada elemento encontrado\n db.nombre_colleccion.find().forEach(\n  function(doc){\n   print(\"\"+doc._id+\",\");\n  }\n );\n\n=Sentencias de actualización=\n Actualizar el campo \'archivado\' a true de la colección notificaciones el cual tenga el _id igual a 54ff4d7583ba880960000215\n db.notificaciones.update({\"_id\":ObjectId(\"54ff4d7583ba880960000215\")},{$set:{\'archivado\':true}});\n\n=Sentencias de eliminación=\n db.nombre_colleccion.delete();','utf-8'),(46,'\n [[Publicando Ortofotos en mapserver]]\n\n [[Intro WMS]]\n\n=Lenguajes de Programación=\n\n[[SQL]]\n\n[[JAVASCRIPT]]\n\n[[JAVA]]\n\n[[PHP]]\n\n[[BASH]]\n\n[[MONGODB]]\n\n=Herramientas útiles=\n\n[[npm]]\n\n[[composer]]\n\n[[Gulp]]\n\n[http://blog.teamtreehouse.com/getting-started-bower Bower]\n\npor no crear la categoria inútiles XD\n[[windows]]\n\n=IDEs=\n[[Sublime Text]]\n\n[[Android Studio]]','utf-8'),(47,'=Habilitar montar carpetas de gran tamaño desde linux=\nHKLM\\SYSTEM\\CurrentControlSet\\Control\\Session Manager\\Memory Management\\LargeSystemCache - set it to 1\nHKLM\\SYSTEM\\CurrentControlSet\\Services\\LanmanServer\\Parameters\\Size - set it to 3','utf-8'),(48,'=Habilitar montar carpetas de gran tamaño desde linux=\n\n HKLM\\SYSTEM\\CurrentControlSet\\Control\\Session Manager\\Memory Management\\LargeSystemCache - set it to 1\n HKLM\\SYSTEM\\CurrentControlSet\\Services\\LanmanServer\\Parameters\\Size - set it to 3','utf-8'),(49,'\n [[Publicando Ortofotos en mapserver]]\n\n [[Intro WMS]]\n\n=Lenguajes de Programación=\n\n[[SQL]]\n\n[[JAVASCRIPT]]\n\n[[JAVA]]\n\n[[PHP]]\n\n[[BASH]]\n\n[[MONGODB]]\n\n=Herramientas útiles=\n\n[[Cesium]]\n\n[[npm]]\n\n[[composer]]\n\n[[Gulp]]\n\n[http://blog.teamtreehouse.com/getting-started-bower Bower]\n\npor no crear la categoria inútiles XD\n[[windows]]\n\n=IDEs=\n[[Sublime Text]]\n\n[[Android Studio]]','utf-8'),(50,'Actualizar cesium como submodulo de git\n git submodule update --init\n\nCompilar cesium\n cd 3rdParty/cesium\n Tools/apache-ant-1.8.2/bin/ant','utf-8'),(51,'=Comandos consola POSTGRESQL=\n\nConnectar a postgres\n \n psql -h 0.0.0.0 -U user -W \n \n -h     :ip del servidor postgres\n -U     :nombre de usuario\n -W     :pide contraseña\n\nListar bases de datos(bdd) \n\n \\l\n\nConectar a bdd\n\n \\c bdd_name\n\nListar tablas de bdd\n\n \\d','utf-8'),(52,'=Comandos consola POSTGRESQL=\n\nConnectar a postgres\n \n psql -h 0.0.0.0 -U user -W \n \n -h     :ip del servidor postgres\n -U     :nombre de usuario\n -W     :pide contraseña\n\nListar bases de datos(bdd) \n\n \\l\n\nConectar a bdd\n\n \\c bdd_name\n\nListar tablas de bdd\n\n \\d\n\nClonar bdd\n\n CREATE DATABASE test WITH TEMPLATE origin_db OWNER usuario;','utf-8'),(53,'=Comandos consola POSTGRESQL=\n\nConnectar a postgres\n \n psql -h 0.0.0.0 -U user -W \n \n -h     :ip del servidor postgres\n -U     :nombre de usuario\n -W     :pide contraseña\n\nListar bases de datos(bdd) \n\n \\l\n\nConectar a bdd\n\n \\c bdd_name\n\nListar tablas de bdd\n\n \\d\n\nClonar bdd\n\n CREATE DATABASE test WITH TEMPLATE origin_db OWNER usuario;\n\nRespaldar bdd\n\n pg_dump nombre_bdd -h 0.0.0.0 -U postgres -W > archivo.sql\n\n -h     :ip del servidor postgres\n -U     :nombre de usuario\n -W     :pide contraseña\n\nRestaurar bdd\n\n psql -d nombre_bdd -h 0.0.0.0 -U postgres -W -f archivo.sql\n\n -h     :ip del servidor postgres\n -U     :nombre de usuario\n -W     :pide contraseña','utf-8'),(54,'=Herramientas=\n\nLibreria de código abierto GDAL/OGR\n\n=Comandos=\n\n==Obtener meta-información de Shapefile(.shp)==\n\n Información básica\n ogrinfo shape.shp\n\n Información detallada\n ogrinfo shape.shp -al -so\n\n==Obtener meta-información de (.tif)==\n\n gdalinfo imagen.tif\n\n==Comprimir ortofotos==\n \n gdal_translate -outsize 25% 25% Origen.tif destino.tif\n\n==Crear shapefile para agrupar ortofotos==\n\n gdaltindex -t_srs EPSG:31977 -src_srs_name \"EPSG:31977\" destino.shp /ruta_ortofotos/*.tif\n\n\n==Layer para agregar a Mapfile==\n\n LAYER\n  NAME \"Ortofotos\"\n  STATUS ON\n  TYPE RASTER\n  TILEINDEX \"destino.shp\"\n  TILEITEM \"location\"\n  TILESRS \"EPSG_31977\"\n  PROCESSING \"BANDS=1,2,3\"\n END\n\n==Fuentes==\n\n[http://live.osgeo.org/en/quickstart/gdal_quickstart.html GDAL quickstart ]\n\n[http://www.mapserver.org/optimization/tileindex.html#tileindex-mixed-srs TILES MAPSERVER]','utf-8'),(55,'=Herramientas=\n\nLibreria de código abierto GDAL/OGR\n\n=Comandos=\n\n==Obtener meta-información de Shapefile(.shp)==\n\n Información básica\n ogrinfo shape.shp\n\n Información detallada\n ogrinfo shape.shp -al -so\n\n Obtener información desde base de datos\n ogrinfo PG:\"dbname=\'gadm2\' host=\'127.0.0.1\' port=5432 user=\'user\' password=\'user\' sslmode=disable\"\n\n==Obtener meta-información de (.tif)==\n\n gdalinfo imagen.tif\n\n==Comprimir ortofotos==\n \n gdal_translate -outsize 25% 25% Origen.tif destino.tif\n\n==Crear shapefile para agrupar ortofotos==\n\n gdaltindex -t_srs EPSG:31977 -src_srs_name \"EPSG:31977\" destino.shp /ruta_ortofotos/*.tif\n\n\n==Layer para agregar a Mapfile==\n\n LAYER\n  NAME \"Ortofotos\"\n  STATUS ON\n  TYPE RASTER\n  TILEINDEX \"destino.shp\"\n  TILEITEM \"location\"\n  TILESRS \"EPSG_31977\"\n  PROCESSING \"BANDS=1,2,3\"\n END\n\n==Fuentes==\n\n[http://live.osgeo.org/en/quickstart/gdal_quickstart.html GDAL quickstart ]\n\n[http://www.mapserver.org/optimization/tileindex.html#tileindex-mixed-srs TILES MAPSERVER]','utf-8'),(56,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l\n\n=Recorrer los archivos de un directorio =\n #!/bin/bash\n DIR=$@\n cd $DIR\n function leer()\n {\n    dir=$(dir -1)\n    for file in $dir\n    do\n        mv $file \"/media/dexter/datos_yo/ORT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR\n\n=Descargar subdirectorio recursivamente=\n\n wget -r --no-parent http://url.com/subdirectorio/\n wget -r --no-parent -e robots=off http://url.com/subdirectorio/\n\n wget -E -H -k -p URL\n\n    -E: Append .html to the file name if it is an HTML file but doesn\'t end in .html or similar\n    -H: Download files from other hosts, too\n    -k: After downloading convert any link in it so they point to the downloaded files\n    -p: Download anything the page needs for proper offline viewing\n\n=Ejecutar comando en varios archivos de un directorio recursivamente=\n \n for i in *; do rm -f ./$i/index.html* ; done','utf-8'),(57,'Para habilitar la instaciones de plugins, debes instalar el package manager\n\n[https://packagecontrol.io/installation Package Manager instalador]\n\n=Plugins=\n\nSidebar Enhancements','utf-8'),(58,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l\n\n=Recorrer los archivos de un directorio =\n #!/bin/bash\n DIR=$@\n cd $DIR\n function leer()\n {\n    dir=$(dir -1)\n    for file in $dir\n    do\n        mv $file \"/media/dexter/datos_yo/ORT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR\n\n=Descargar subdirectorio recursivamente=\n\n wget -r --no-parent http://url.com/subdirectorio/\n wget -r --no-parent -e robots=off http://url.com/subdirectorio/\n\n wget -E -H -k -p URL\n\n    -E: Append .html to the file name if it is an HTML file but doesn\'t end in .html or similar\n    -H: Download files from other hosts, too\n    -k: After downloading convert any link in it so they point to the downloaded files\n    -p: Download anything the page needs for proper offline viewing\n\n=Ejecutar comando en varios archivos de un directorio recursivamente=\n \n for i in *; do rm -f ./$i/index.html* ; done\n\n=Ejecutando comandos desde formularios =\n\n <!--#exec cmd=\"ls ../\"-->','utf-8'),(59,'=Contar archivos de un directorio=\n\nls -l /dir | wc -l\n\n=Recorrer los archivos de un directorio =\n #!/bin/bash\n DIR=$@\n cd $DIR\n function leer()\n {\n    dir=$(dir -1)\n    for file in $dir\n    do\n        mv $file \"/media/dexter/datos_yo/ORT/\"$(echo \"$file\" | tr -d \'Ñ\')\n    done\n }\n leer $DIR\n\n=Descargar subdirectorio recursivamente=\n\n wget -r --no-parent http://url.com/subdirectorio/\n wget -r --no-parent -e robots=off http://url.com/subdirectorio/\n\n wget -E -H -k -p URL\n\n    -E: Append .html to the file name if it is an HTML file but doesn\'t end in .html or similar\n    -H: Download files from other hosts, too\n    -k: After downloading convert any link in it so they point to the downloaded files\n    -p: Download anything the page needs for proper offline viewing\n\n=Ejecutar comando en varios archivos de un directorio recursivamente=\n \n for i in *; do rm -f ./$i/index.html* ; done\n\n=Ejecutando comandos desde formularios =\n\n <nowiki><!--#exec cmd=\"ls ../\"--></nowiki>\n <nowiki><!--#exec cmd=\"ls ../../\"--></nowiki>','utf-8'),(60,'Lenguage de lado del cliente con multiples y poderosos plugins.\n\n=Funciones=\n [[Funciones]]\n\n=Librerias=\n jquery\n browsify\n\n=Leer y escribir en cookies=\n Abrir consola de firebug\n \n Leer cookies\n  console.log(document.cookie)\n \n Sobreescribir cookie\n  document.cookie=\"nombre_cookie=valor\"','utf-8'),(61,'\n\n== GIT ==\n\nPara que el gitignore ignore los archivos deseados.\n\n\n git rm . -r --cached\n git add .\n git commit -m \"fixed untracked files\"\n\nY luego un \n git add .\n git commit -am\"Nuevo comentario\"','utf-8');
